                            <label for="header">Header = <input type="number" id="header" value="0.3" min="0" step="0.05"></label>
                            <label for="footer">Footer = <input type="number" id="footer" value="0.3" min="0" step="0.05"></label>
                        </fieldset>
                    </div>
                    <div>
                        <input type="submit" style="margin: 5px 0px; font-weight: bold;" value="Export to Excel">
                    </div>
                </form>
                <div class="grid-wrapper">
                    <ag-grid-vue

                style="width: 100%; height: 100%;"
                :class="themeClass"
                :columnDefs="columnDefs"
                @grid-ready="onGridReady"
                :defaultColDef="defaultColDef"
                :popupParent="popupParent"
                :rowData="rowData"></ag-grid-vue>
                </div>
            </div>
        </div>
    `,
    components: {
        'ag-grid-vue': AgGridVue,

    },
    data: function() {
        return {
            columnDefs: [
            {
                field:"athlete",
                minWidth:200},
            {
                field:"country",
                minWidth:200
            },
            {
                field:"sport",
                minWidth:150
            },
            {
                field:"gold"
            },
            {
                field:"silver"
            },
            {
                field:"bronze"
            },
            {
                field:"total"
            }
        ],
        gridApi: null,
        defaultColDef: {
            filter: true,
            minWidth: 100,
            flex: 1,
        },
        popupParent: null,
        rowData: null,
        themeClass: /** DARK MODE START **/document.documentElement.dataset.defaultTheme || 'ag-theme-quartz'/** DARK MODE END **/,
        }
    },
    created() {
        this.popupParent = document.body
    },
    methods: {
        onFormSubmit(e) {
            e.preventDefault();
            const { pageSetup, margins } = getSheetConfig();
            this.gridApi.exportDataAsExcel({ pageSetup, margins });
        },

        onGridReady(params) {
            this.gridApi = params.api;

            const updateData = (data) => params.api.setGridOption('rowData', data.filter((rec) => rec.country != null));

            fetch('https://www.ag-grid.com/example-assets/small-olympic-winners.json')
                .then(resp => resp.json())
                .then(data => updateData(data));
        },
    }
}

window.getNumber = function getNumber(id) {
    var el = document.querySelector(id);
    if (!el || isNaN(el.value)) {
        return 0;
    }
    return parseFloat(el.value);
}

window.getValue = function getValue(id) {
    return (document.querySelector(id)).value;
}

window.getSheetConfig = function getSheetConfig() {
    return {
        pageSetup: {
            orientation: getValue('#pageOrientation'),
            pageSize: getValue('#pageSize'),
        },
        margins: {
            top: getNumber('#top'),
            right: getNumber('#right'),
            bottom: getNumber('#bottom'),
            left: getNumber('#left'),
            header: getNumber('#header'),
            footer: getNumber('#footer'),
        },
    };
}

new Vue({
    el: '#app',
    components: {
        'my-component': VueExample
    }
});

